import React, {useState, useEffect} from "react";

import "../Form.css";

function SidaSammanlagdStats({patienter, totaltTillagda}) {
  const [periodStart, setPeriodStart] = useState("");
  const [periodSlut, setPeriodSlut] = useState("");
  return (
    <>
      <p>totalt inlagda: {totaltTillagda}</p>
      <form>
        <div className="form-container">
          <label>start {periodStart}</label>
          <input
            type="date"
            value={periodStart}
            onChange={(e) => setPeriodStart(e.target.value)}
          />
          <label>slut {periodSlut}</label>
          <input
            type="date"
            value={periodSlut}
            onChange={(e) => setPeriodSlut(e.target.value)}
            placeholder="ange slut datum"
          />
        </div>
      </form>
    </>
  );
}

export default SidaSammanlagdStats;
